if mibBuilder.loadTexts: sechtor100ConfigTable.setDescription("This table contains redundancy variables and environmental variables for monitoring fans and thermometers. For redundancy, the peer MAC address is maintained in this table. Also, one variable specifies whether redundancy is enabled or not. There are two thermometers on the Sechtor 100 board. In this MIB, thermometers 'A' and 'B' are used to differentiate these two thermometers: Thermometer A - the thermometer located near the 750 processor. It is expected that this thermometer have a higher temperature reading than thermometer B because of the heat generated by the processor. It is recommended that a higher upper threshold is set for this thermometer. Thermometer B - the thermometer located near the outlet on the right side of the Sechtor 100 board. The profile for this table will be auto-created as 1/1 with the sechtor100RedundancyEnable variable set to FALSE. This profile should not be deleted except for the following two cases: 1) When a unit operating in simplex mode is intended to be used in duplex mode as the slot 2 of the redundant system. The user needs to create a 1/2 profile. 2) The unit configured as slot 2 of a redundant system is intended to be used in simplex mode. Then the 1/2 profile should be deleted and replaced with a 1/1 profile.")
